import React from 'react';

import BrandBar from './BrandBar.js';
import NavBar from './NavBar.js';

export default class Top extends React.Component {
    constructor(props) {
        super(props);
    }

    render() {
        return (
            <div style={{position: 'sticky', top: 0, display: 'flex', flexDirection: 'column', alignItems: 'center', background: 'white'}}>
                <BrandBar />
                <NavBar />
            </div>
        );
    }
}
